var loadData=function(o){var e=new XMLHttpRequest;e.open("GET",o),e.onload=function(){if(e.status>=200&&e.status<400){console.log("Data loaded successfully; server code: "+e.status);var o=JSON.parse(e.responseText);return console.log(o),o}return console.log("Data did not load successfully; error code: "+e.status),!1},e.onerror=function(){return console.log("There was a network error."),!1},e.send()};